import React from "react";

const Budget = () => {
  return (
    <div>
      <h4>Budget</h4>
      <div className="budger-wrapper">
        <input type="range" min="50" max="5000" value="100" id="slider-1" />
        <input type="range" min="50" max="5000" value="500" id="slider-2" />
      </div>
    </div>
  );
};

export default Budget;
